local all_im = nil
local game_step = 1
local CI = {}
local null_cell = 0
local r = 0
local data = {
	anim = {},
	anim_frames = 7,
	settings_open = false,
	moves = 0,
	NT = true,
	start_time = 0,
	end_time = 0,
	lockwin = false
}
function random(x, y)
    x = x or 0
    y = y or 0
    math.randomseed(os.time() * math.random(1000, 1000000))
    r = r + tonumber(math.random(1000, 1000000))
    if x == 0 and y == 0 then math.randomseed(r) if (math.random(r) % 2) == 1 then return 1 else return 0 end
    elseif x ~= 0 and y == 0 then math.randomseed(r) return math.random(x)
    else math.randomseed(r) return math.random(x, y) end
end
function checkwon()
	local n = true
	for i = 1, 15 do if CI[i] ~= i then n = false break end end
	if n and null_cell == 16 then game_step = 2; data.end_time = os.clock() end
end
function Start15()
   	game_step = 1
   	for i = 1, 16 do CI[i] = 0 end
   	for i = 1, 15 do
	   	::zanyato::
	   	local a = random(15)
	   	if CI[a] ~= 0 then goto zanyato else CI[a] = i end
	end
	for i = 1, 16 do if CI[i] == 0 then null_cell = i break end end
   	--WinOpen[0] = true
   	data.anim = {}
   	data.moves = 0
   	data.settings_open = false
   	data.start_time = os.clock()
   	checkwon()
end
function Move(kuda)
	if #data.anim ~= 0 then return false end
   	if game_step ~= 1 then return false end
	if kuda == 1 then
		data.anim = {null_cell-4, data.anim_frames, 0, 64/data.anim_frames, function()
			CI[null_cell] = CI[null_cell-4] null_cell = null_cell-4;
			checkwon();
			data.moves = data.moves + 1
		end}
	elseif kuda == 2 then
		data.anim = {null_cell+4, data.anim_frames, 0, -64/data.anim_frames, function()
			CI[null_cell] = CI[null_cell+4] null_cell = null_cell+4;
			checkwon();
			data.moves = data.moves + 1
		end}
	elseif kuda == 3 then
		data.anim = {null_cell-1, data.anim_frames, 64/data.anim_frames, 0, function()
			CI[null_cell] = CI[null_cell-1] null_cell = null_cell-1;
			checkwon();
			data.moves = data.moves + 1
		end}
	else
		data.anim = {null_cell+1, data.anim_frames, -64/data.anim_frames, 0, function()
			CI[null_cell] = CI[null_cell+1] null_cell = null_cell+1;
			checkwon();
			data.moves = data.moves + 1
		end}
	end
end
function main()
   	while not isSampAvailable() do wait(100) end
   	--sampRegisterChatCommand('15', function() WinOpen[0] = not WinOpen[0] end)
   	wait(-1)
end
imgui.OnInitialize(function()
	all_im = imgui.CreateTextureFromFileInMemory(imgui.new('const char*', all_im_data), #all_im_data)
end)
local Win = imgui.OnFrame(
function() return WinOpen[0] end,
function(player)
	if imgui.GetFrameCount() == 1 then
		Start15()
		sampAddChatMessage("{00CCFF}[15]{FFFFFF} : W/A/S/D    ,   ", -1)
		sampAddChatMessage("{00CCFF}[15]{FFFFFF}   -      |   - R", -1)
		sampAddChatMessage("{00CCFF}[15]{FFFFFF}        /15", -1)
   		imgui.SetNextWindowSize(imgui.ImVec2(275,275))
	end
   	imgui.Begin('15', WinOpen, imgui.WindowFlags.NoScrollbar + imgui.WindowFlags.NoTitleBar + (data.lockwin and imgui.WindowFlags.NoMove or 0))
   	local mpos = imgui.GetMousePos()
   	local WP = imgui.GetWindowPos()
   	local WS = imgui.GetWindowSize()
   	local cellsize = math.min(WS.x, WS.y)/4.239
   	if mpos.x > WP.x and mpos.x < WP.x+WS.x and mpos.y > WP.y and mpos.y < WP.y+WS.y and imgui.IsMouseClicked(1, false) then data.settings_open = not data.settings_open end
   	if data.settings_open then
   		imgui.PushTextWrapPos(WS.x)
   		if imgui.Checkbox(u8"##NT", imgui.new.bool(data.NT)) then data.NT = not data.NT end
   		imgui.SameLine()
   		imgui.Text(u8"    ")

   		if imgui.Checkbox(u8"##NM", imgui.new.bool(data.lockwin)) then data.lockwin = not data.lockwin end
   		imgui.SameLine()
   		imgui.Text(u8"  ")
   		imgui.PopTextWrapPos()
	else
	   	if game_step == 1 then
	   		for i = 1, 16 do
	   			local saveCur = imgui.GetCursorPos()
	   			local px = i%4-1; if px == -1 then px = 3 end
	   			local py = math.ceil(i/4)-1;
	   			imgui.SetCursorPos({x=10+px*cellsize,y=10+py*cellsize})
	   			if null_cell == i then imgui.Image(all_im, {x=cellsize,y=cellsize}, {0,0}, {0.25, 0.25}, imgui.ImVec4(0,0,0,0), imgui.ImVec4(0,0,0,0))
	   			else
	   				if i == data.anim[1] then
	   					imgui.SetCursorPosX(imgui.GetCursorPosX() + data.anim[3]*(data.anim_frames - data.anim[2]))
	   					imgui.SetCursorPosY(imgui.GetCursorPosY() + data.anim[4]*(data.anim_frames - data.anim[2]))
	   					data.anim[2] = data.anim[2] -1
	   					if data.anim[2] <= 0 then
	   						 data.anim[5]()
	   						 data.anim = {}
	   					end
	   				end
	   				imgui.Image(all_im, imgui.ImVec2(cellsize, cellsize), {(CI[i]%4)*0.25, math.floor(CI[i]/4)*0.25}, {(CI[i]%4)*0.25 + 0.25, math.floor(CI[i]/4)*0.25 + 0.25}, imgui.ImVec4(1,1,1,(data.NT and CI[i] == i) and 1 or data.NT and 0.75 or 1))
	   				if imgui.IsItemClicked() then if i+1 == null_cell then Move(3) elseif i-1 == null_cell then Move(4) elseif i-4 == null_cell then Move(2) elseif i+4 == null_cell then Move(1) end end
	   			end
	   			--if (i%4)~=0 then imgui.SameLine() imgui.SetCursorPosY(saveCur.y) end
			end
	   	elseif game_step == 2 then
   			imgui.PushTextWrapPos(WS.x)
	   			imgui.Text(u8" ,     \"!\"")
	   			imgui.Text(u8(",     : "..data.end_time-data.start_time.." "))
	   			imgui.Text(u8(" ,   : "..data.moves))
	   			imgui.Text(u8"   ,     !")
	   			imgui.Text(u8"        R")
   			imgui.PopTextWrapPos()
	   	end
	end
	if not sampIsCursorActive() then
	   	if 	   imgui.IsKeyPressed(0x57, false) and null_cell < 13 	then Move(2) -- up
	   	elseif imgui.IsKeyPressed(0x53, false) and null_cell > 4 	then Move(1) -- down
	   	elseif imgui.IsKeyPressed(0x41, false) and null_cell%4 ~= 0 then Move(4) -- left
	   	elseif imgui.IsKeyPressed(0x44, false) and null_cell%4 ~= 1 then Move(3) -- right
	   	elseif imgui.IsKeyPressed(0x52, false) then Start15()
   	end end
	imgui.End()
end)
